    true,nt"url": null,nt"notes": "AIRS/Aqua Level 3 monthly quantization product
    in physical units (Without HSB).n      n      The quantization products (QP) are
    distributional summaries derived from the Level-2 standard retrieval products (of
    swath type) to provide a more comprehensive set of statistical summaries than the
    traditional means and standard deviation. The QP products combine the Level 2 standard
    data parameters over grid cells of 5 x 5 deg spatial extent for temporal periods
    of a month. They preserve the multivariate distributional features of the original
    data and so provide a compressed data set that more accurately describes the disparate
    atmospheric states that is in the original Level-2 swath data set.n      n      The
    geophysical parameters are: Air Temperature and Water Vapor profiles (11 levels/layers),
    Cloud fraction (vertical distribution).n      n      The Shortname for this product
    is AIRX3QPM).",nt"owner_org": "d8a6202b-c0c3-463d-88a0-3bc021a178ed",nt"extras":
